description:
In Dream Day Honeymoon, travel through the tropics with Jenny &amp; Robert as they search for the perfect souvenirs to bring home from their Honeymoon. There is beauty and adventure around every corner, but beware of Honeymoon Crises that could turn their honeymoon into a travel disaster! Dream Day Honeymoon is the sequel to Dream Day Wedding, and combines seek-and-find fun with match mini-games!
